import SideNotation from "./side-notation/side-notation";
import Chessboard from "./Chessboard/Chessboard";
import "./App.css";

function App() {
  return (
    <div className="App">
      <h1>Chess in Javascript & SCSS</h1>
      <SideNotation />
      <Chessboard />
      <div id="history">
        <h2>Move History</h2>
      </div>
    </div>
  );
}

export default App;
